import React from 'react';
import { Icon } from '@iconify/react';
import { Link } from 'react-router-dom';

class Contact extends React.Component {
  render() {
    return (
      <div>
        <div>
          <a target="_blank" rel="noreferrer" href="https://github.com/fernandacajueiro">
            <Icon className="iconify" icon="ion:logo-github" style={ {color: "#212529"} } width="50" height="50" />
          </a>
        </div>

        <div>
          <a target="_blank" rel="noreferrer" href="https://www.linkedin.com/in/fernandacajueiro/">
            <Icon className="iconify" icon="ion:logo-linkedin" style={ {color: "#212529"} } width="50" height="50" />
          </a>
        </div>
      </div>
    )
  }
};

export default Contact;
